import React, { Component } from 'react';
import Inici from './Components/SelectPoblacio';
import { findRenderedDOMComponentWithClass } from 'react-dom/test-utils';
import axios from 'axios';


class App extends Component {

  render() {

    return (
      <div className="app conteiner">
        <div className="jumbotron">
        <h1 className="lead text-center">Benvinguts</h1>
        </div>
        <div className="container">
        <form>
                <div className="form-row">
                    <div className="form-group col-md-3">
                        <label>Nom restaurant</label>
                        <input ref={this.nom} type="text" className="form-control" placeholder="" />
                    </div>
                      <Inici/>
                    <div class="form-group col-md-3">
                        <label>Especialitat</label>
                        <select id="especialitat" class="form-control" name="especialitat">
                            <option selected>Selecciona</option>
                        </select>
                    </div>
                    <div className="form-group col-md-3">
                        <input type="submit" className="btn btn-lg btn-danger" value="Cercar" />
                    </div>

                </div>
            </form>
        </div>
      </div>
    );
  }

}

export default App;
